import React, { useState } from 'react';
import { Route, Link, Routes } from 'react-router-dom';
import '../styles/AdminDashboard.css';
import ManageUsers from './ManageUsers';
import ManageArtworks from './ManageArtworks';
import SiteSettings from './SiteSettings';

const AdminHomePage = () => {
  const [isSidebarExpanded, setIsSidebarExpanded] = useState(false);

  return (
    <div className="admin-dashboard">
      {/* Sidebar */}
      <div className={`vertical-sidebar ${isSidebarExpanded ? 'expanded' : ''}`}>
        <div 
          className="sidebar-item" 
          onClick={() => setIsSidebarExpanded(!isSidebarExpanded)}
        >
          <span className="sidebar-icon">≡</span>
          <span className="sidebar-text">Toggle</span>
        </div>
        <div className="sidebar-item">
          <Link to="/admin" className="sidebar-link">
            <span className="sidebar-icon">🏠</span>
            <span className="sidebar-text">Home</span>
          </Link>
        </div>
        <div className="sidebar-item">
          <Link to="/manage-users" className="sidebar-link">
            <span className="sidebar-icon">👤</span>
            <span className="sidebar-text">Manage Users</span>
          </Link>
        </div>
        <div className="sidebar-item">
          <Link to="/admin/manage-artworks" className="sidebar-link">
            <span className="sidebar-icon">🖼️</span>
            <span className="sidebar-text">Manage Artworks</span>
          </Link>
        </div>
        <div className="sidebar-item">
          <Link to="/admin/site-settings" className="sidebar-link">
            <span className="sidebar-icon">⚙️</span>
            <span className="sidebar-text">Site Settings</span>
          </Link>
        </div>
      </div>

      {/* Main Content */}
      <div 
        className="dashboard-content" 
        style={{ marginLeft: isSidebarExpanded ? '200px' : '60px' }}
      >
        <h1>Admin Dashboard</h1>
        <p>Welcome to the Admin Dashboard where you can manage users, artworks, and permissions.</p>

        <div className="page-content">
          <Routes>
            <Route path="/admin" element={<HomeContent />} />
            <Route path="/admin/manage-users" element={<ManageUsers />} />
            <Route path="/admin/manage-artworks" element={<ManageArtworks />} />
            <Route path="/admin/site-settings" element={<SiteSettings />} />
          </Routes>
        </div>
      </div>
    </div>
  );
};

const HomeContent = () => (
  <div>
    <h2>Welcome, Admin!</h2>
    <p>This is your admin home page where you can find an overview of the dashboard functionalities.</p>
  </div>
);

export default AdminHomePage;
